import React from 'react';
import './Header.css';  // Ensure consistent styling
import gogo from'./Logo.jpeg';

function Logo() {
  return (
    <div className="logo">
      <img src=".src/pictures/Logo.jpeg" alt="MediaFlow" />
      <img src={gogo} />
    </div>
  );
}
export default Logo;
